If I could say it louder I would. I, like many, struggle with self confidence, though I might be winning that battle most of the time, that doesn’t mean some days I don’t feel like I am doing it as big or as well as my successful and very talented counterparts. The mental game is HUGE. Especially today. 

But may I remind you again, no matter who is next to you or across from you or similar to you, rest assure, THERE IS ONLY ONE YOU! You are UNIQUE. Allow that to shine and grow and INVEST in that…and celebrate your peers wins…the universe is BIG and has plenty of room for ALL to expand! Blessings. -M.R.K.

